// RwD
@mixin respond-down($width) {
    @media screen and (max-width: $width) { @content }
};
@mixin respond-above($width) {
    @media screen and (min-width: $width) {@content}
};


@mixin respond($breakpoint) {
    @media  screen and (min-width: map-get($breakpoints, $breakpoint)){@content}
};


// clear both
@mixin clear {
    &::after {
        content: '';
        display: block;
        clear: both;
    }
};


// :link , :visited
@mixin link {
    &:link,
    &:visited {
        @content
    }
};

// about position
@mixin ab-fill-ct {
    position: absolute; 
    top: 0; bottom: 0; right: 0; left: 0;
    margin: auto;
};

@mixin ab-fill($grow: 0) {
    position: absolute;
    left: 0 + $grow;
    right: 0 + $grow;
    top: 0 + $grow;
    bottom: 0 + $grow;
}

@mixin position-all($grow) {
    left: $grow;
    right: $grow;
    top: $grow;
    bottom: $grow;
}

// btn
@mixin btn-base($shadow-border:true,$b-radius-level:0,$f-size-level:2,$p-tb:1.2rem,$p-rl:1.8rem) {
    &:link,
    &:visited {
        display: inline-block;
        text-decoration: none;
        color: #000;
        font-size: nth($font-size,$f-size-level);
        padding: $p-tb $p-rl;
        @if $shadow-border {box-shadow: 0 0 0 1px #000;}
        @if $b-radius-level > 0 {border-radius: nth($border-radius , $b-radius-level);}
    }
};

@mixin btn-base-button($shadow-border:true,$b-radius-level:0,$f-size-level:2,$p-tb:1.2rem,$p-rl:1.8rem) {
    border: none;
    background: #fff;
    font-size: nth($font-size,$f-size-level);
    padding: $p-tb $p-rl;
    @if $shadow-border {box-shadow: 0 0 0 1px #000;}
    @if $b-radius-level > 0 {border-radius: nth($border-radius , $b-radius-level);}
}

@mixin btn-arrow($size:30px) {
    width: $size;
    height: $size;

    &::before,&::after {
        content: '';
        @extend %ab-fill;
        background-color: $color-black;
    }


    &::before {
        margin-top: auto;
        margin-bottom: auto;
        height: 0;
        padding: 1.5px 0;
    }

    &::after {
        background: transparent;
        width: $size / 2; height: $size / 2;  
        left: 10px;
        margin: auto;
        border-width: 0;
        border-top: 3px;
        border-right-width: 3px;
        border-style: solid;
        transform: rotateZ(45deg);
    }
}

@mixin btn-direct($bk:false,$hover:false,$size:15px,$weight:3px,) {
    position: absolute;
    top: 0; bottom: 0;
    width: 36px;
    height: 60px;
    margin-top: auto;
    margin-bottom: auto;
    cursor: pointer;

    @if($bk) { background-color: rgba($color-black,.3); }

    > span {
        position: absolute;
        top: 0; bottom: 0;
        margin-top: auto;
        margin-bottom: auto;
        width: $size;
        height: $size;
        cursor: pointer;

        &::after {
            content: '';
            position: absolute;
            left: 0; right: 0; top: 0; bottom: 0;
            margin: auto;
            border-width: 0;
            border-style: solid;
            border-top-width: $weight;
            color: $controlerArrowColor;
        }
    }

    &.next {
        right: 15px;

        > span {
            left: 6.9px;
            transform: rotateZ(45deg);
            &::after {
                border-right-width: $weight;
            }
        }
    }

    &.prev {
        left: 15px;

        > span {
            right: 6.9px;
            transform: rotateZ(-45deg);
            &::after {
            border-left-width: $weight;
            }
        }
    }

    @if($hover) {

        // transition
        opacity: 0;
        transition: opacity .3s;

        &:hover {
            > span {
                &::after {
                    color: $controlerArrowColorHover;
                }
            }
        }
