            color: map-get(map-get($btn-ani-config,flyin),color);
        }

        &:hover::after {
            transform: translateX(0) skewX(-15deg);
        }
    }
}

@mixin btn-ani($mode,$ani-type:0) {
    @if get-mode($btn-ani,$mode) == flyin {
        @include btn-flyin($ani-type);
    }
}

